// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "./levels/base/Level.sol";
import "openzeppelin-contracts-08/access/Ownable.sol";

interface IStatistics {
    function saveNewLevel(address level) external;

    function createNewInstance(
        address instance,
        address level,
        address player
    ) external;

    function submitFailure(
        address instance,
        address level,
        address player
    ) external;

    function submitSuccess(
        address instance,
        address level,
        address player
    ) external;
}

contract Ethernaut is Ownable {
    IStatistics public statistics;

    // ----------------------------------
    // Owner interaction
    // ----------------------------------

    mapping(address => bool) public registeredLevels;
    mapping(address => string) public playersName;
    mapping(address => string) public playersTG;

    // Only registered levels will be allowed to generate and validate level instances.
    function registerLevel(Level _level) public onlyOwner {
        registeredLevels[address(_level)] = true;
        statistics.saveNewLevel(address(_level));
    }

    function setStatistics(address _statProxy) external onlyOwner {
        statistics = IStatistics(_statProxy);
    }

    // ----------------------------------
    // Get/submit level instances
    // ----------------------------------

    struct EmittedInstanceData {
        address player;
        Level level;
        bool completed;
    }

    mapping(address => EmittedInstanceData) public emittedInstances;

  event LevelInstanceCreatedLog(address indexed player, address instance, string nickname);
  event LevelCompletedLog(address indexed player, Level level, string nickname);

  function register(string memory _nickname, string memory _tg) public returns(bool) {
    if(bytes(_nickname).length > 0 && bytes(playersName[msg.sender]).length == 0) {
      playersName[msg.sender] = _nickname;
      playersTG[msg.sender] = _tg;
      return true;
    }
    return false;
  }

    function createLevelInstance(Level _level) public payable {
        // Ensure level is registered.
        require(registeredLevels[address(_level)], "This level doesn't exists");

        // Get level factory to create an instance.
        address instance = _level.createInstance{value: msg.value}(msg.sender);

        // Store emitted instance relationship with player and level.
        emittedInstances[instance] = EmittedInstanceData(
            msg.sender,
            _level,
            false
        );

        statistics.createNewInstance(instance, address(_level), msg.sender);

        // Retrieve created instance via logs.
        emit LevelInstanceCreatedLog(msg.sender, instance, playersName[msg.sender]);
    }

    function submitLevelInstance(address payable _instance) public {
        // Get player and level.
        EmittedInstanceData storage data = emittedInstances[_instance];
        require(
            data.player == msg.sender,
            "This instance doesn't belong to the current user"
        ); // instance was emitted for this player
        require(data.completed == false, "Level has been completed already"); // not already submitted

        // Have the level check the instance.
        if (data.level.validateInstance(_instance, msg.sender)) {
            // Register instance as completed.
            data.completed = true;

            statistics.submitSuccess(
                _instance,
                address(data.level),
                msg.sender
            );
            // Notify success via logs.
            emit LevelCompletedLog(msg.sender, data.level, playersName[msg.sender]);
        } else {
            statistics.submitFailure(
                _instance,
                address(data.level),
                msg.sender
            );
        }
    }
}

contracts/factory/LocalFactory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
// import all the abi's required to deploy
import {Ownable} from "openzeppelin-contracts-08/access/Ownable.sol";
import {Ethernaut} from "../Ethernaut.sol";
import {Statistics} from "../metrics/Statistics.sol";
import {ProxyStats} from "../proxy/ProxyStats.sol";
import {ProxyAdmin} from "../proxy/ProxyAdmin.sol";
import {Level} from "../levels/base/Level.sol";

// deploy all the nexessary contract in steps
contract Factory is Ownable {
    Ethernaut public ethernaut;
    ProxyAdmin public proxyAdmin;
    Statistics public implementation;
    ProxyStats public proxyStats;

    constructor() {
        // deploy the four core contracts
        ethernaut = new Ethernaut();
        proxyAdmin = new ProxyAdmin();
        implementation = new Statistics();
        proxyStats = new ProxyStats(
            address(implementation),
            address(proxyAdmin),
            address(ethernaut)
        );
        // initialise the ethernaut contract with the proxystats method
        ethernaut.setStatistics(address(proxyStats));
        // here is where statistics seats behind the proxy
        implementation = Statistics(address(proxyStats));
    }

    // use this function to register a level since this address is the owner of ethernaut
    function registerLevel(Level _level) public onlyOwner {
        ethernaut.registerLevel(_level);
    }

    // use this function to transfer the ownership of the ethernaut contract to a new user(ethernaut?)
    function transferContractsOwnership(address _newOwner) public onlyOwner {
        ethernaut.transferOwnership(_newOwner);
        proxyAdmin.transferOwnership(_newOwner);
        transferOwnership(_newOwner);
    }
}

